description:
For more info on this classic Spider-Man story, please check the wikilink here: &lt;a href=&quot;
http://en.wikipedia.org/wiki/Sinister_Six#Return_of_the_Sinister_Six&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://en.wikipedia.org/wiki/Sinister_Six#Return_of_the_Sinister_Six&lt;/a&gt;

One of the classic 90's Spider-Man stories, &quot;The Return of the Sinister Six&quot; sees the old gang of villains bust out of prison - and some new faces added to the mix, given Kraven the Hunter's suicide. This time though, Spidey has help from a rather unexpected source. Not the fanciest story, but this pure beat-em-up goodness is pretty fun to read still, with some great art especially in the action scenes. This digital copy is provided by Minutemen-InnderDemons, so thanks to them. Enjoy and please seed! :-)
